const LEVEL_DEBUG = Symbol('LEVEL_DEBUG');
const LEVEL_INFO = Symbol('LEVEL_INFO');
const LEVEL_WARNING = Symbol('LEVEL_WARNING');
const LEVEL_ERROR = Symbol('LEVEL_ERROR');

const LOG_PREFIX = {
    [LEVEL_DEBUG]: 'DEBUG',
    [LEVEL_INFO]: 'INFO',
    [LEVEL_WARNING]: 'WARN',
    [LEVEL_ERROR]: 'ERROR',
};

let defaultLog = null;

class Log {
    constructor(writable, prefix = '') {
        this.writable = writable;
        this.prefix = prefix;
    }

    log(level, message) {
        if (!(level in LOG_PREFIX)) {
            throw new Error(`Invalid log level ${level}`);
        }
        message
            .split('\n')
            .forEach(line => this.writable.write(`${LOG_PREFIX[level]} ${this.prefix}${line}\n`));
    }

    debug(message) {
        this.log(LEVEL_DEBUG, message);
    }

    info(message) {
        this.log(LEVEL_INFO, message);
    }

    warn(message) {
        this.log(LEVEL_WARNING, message);
    }

    error(message) {
        this.log(LEVEL_ERROR, message);
    }

    /**
     * Get the default log instance wired with STDOUT
     * @returns the Log instance
     */
    static getDefault() {
        if (defaultLog == null) {
            defaultLog = new Log(process.stderr);
        }
        return defaultLog;
    }

    /**
     * Get a log instance wired with STDOUT that also has a prefix
     * @returns the Log instance
     */
    static getDefaultWithPrefix(prefix) {
        return prefix ? new Log(process.stderr, prefix) : Log.getDefault();
    }

    /**
     * Returns a log instance that does nothing (like writing to /dev/null)
     * @returns {Log}
     */
    static getDevNull() {
        return new Log({ write: () => {} });
    }

    static redirectConsole(stderr) {
        const original = {
            log: console.log,
            info: console.info,
            warn: console.warn,
            error: console.error,
            dir: console.dir,
            time: console.time,
            timeEnd: console.timeEnd,
            trace: console.trace,
            assert: console.assert,
        };

        function restoreConsole() {
            // eslint-disable-next-line no-restricted-syntax
            for (const method of Object.keys(original)) {
                console[method] = original[method];
            }
        }

        const newConsole = new console.Console(stderr, stderr);
        const dest = new Log(stderr);

        // eslint-disable-next-line no-restricted-syntax
        for (const method of Object.keys(original)) {
            console[method] = newConsole[method].bind(newConsole);
        }

        console.log = (...args) => {
            dest.debug(util.format(...args));
        };
        console.info = (...args) => {
            dest.info(util.format(...args));
        };
        console.warn = (...args) => {
            dest.warn(util.format(...args));
        };
        console.error = (...args) => {
            dest.error(util.format(...args));
        };

        return restoreConsole;
    }
}

